-- 建立数据库
-- drop database if exists flood;
create database flood;
use flood;

-- 建立数据库表
/*
	# flooddata
	降水量
    地形坡度
    植被覆盖率
    高楼遮挡
    路面材料透水性
    其他因素
    地下水位高度
    附近水体水位
    蒸发能力
    自然排水路径
    排水设施维护状况
    地下管道系统负载
    施工或改建工程
    校园垃圾和污染物
    城市排水系统关联性
*/
DROP TABLE IF EXISTS flooddata;
CREATE TABLE flooddata (
    `降水量` VARCHAR(255) NOT NULL,
    `地形坡度` VARCHAR(255) NOT NULL,
    `植被覆盖率` VARCHAR(255) NOT NULL,
    `高楼遮挡` VARCHAR(255) NOT NULL,
    `路面材料透水性` VARCHAR(255) NOT NULL,
    `其他因素` VARCHAR(255) NOT NULL,
    `地下水位高度` VARCHAR(255) NOT NULL,
    `附近水体水位` VARCHAR(255) NOT NULL,
    `蒸发能力` VARCHAR(255) NOT NULL,
    `自然排水路径` VARCHAR(255) NOT NULL,
    `排水设施维护状况` VARCHAR(255) NOT NULL,
    `地下管道系统负载` VARCHAR(255) NOT NULL,
    `施工或改建工程` VARCHAR(255) NOT NULL,
    `校园垃圾和污染物` VARCHAR(255) NOT NULL,
    `城市排水系统关联性` VARCHAR(255) NOT NULL,
    PRIMARY KEY (`降水量`)  -- 假设降水量是唯一标识
);


